description:
These are LuaJIT 2.0.1 binaries for Windows.

The binaries have been built from LuaJIT git HEAD (commit 172bd95 on March 23, 2013 at 14:51:23 GMT+0100) with /DLUAJIT_ENABLE_LUA52COMPAT option (see http://luajit.org/extensions.html#lua52).

----------------
Latest LuaJIT binaries for Windows are available at &lt;a href=&quot;
http://luajit4win.no-ip.org&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
